import React, { useCallback, useState } from 'react';
import { useDropzone } from 'react-dropzone';

const Main = () => {
  const [files, setFiles] = useState([]);

  const onDrop = useCallback(acceptedFiles => {
    setFiles(acceptedFiles.map(file => ({
      name: file.name,
      path: file.path
    })));
  }, []);

  const { getRootProps, getInputProps } = useDropzone({
    onDrop,
    accept: 'application/pdf'
  });

  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>AcquiSolar</h1>
        <a href="/about" style={styles.aboutLink}>About Us</a>
      </header>
      <div {...getRootProps({ style: styles.dropzone })}>
        <input {...getInputProps()} />
        <p>Just drag and drop your files. We'll do the rest.</p>
      </div>
      <ul style={styles.fileList}>
        {files.map(file => (
          <li key={file.path}>{file.name}</li>
        ))}
      </ul>
      <button style={styles.analyzeButton}>Analyze</button>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    textAlign: 'center',
    paddingTop: '50px'
  },
  header: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '0 20px'
  },
  title: {
    margin: 0
  },
  aboutLink: {
    textDecoration: 'none',
    color: 'blue',
    fontSize: '18px'
  },
  dropzone: {
    border: '2px dashed #cccccc',
    borderRadius: '5px',
    padding: '20px',
    width: '50%',
    margin: '20px auto'
  },
  fileList: {
    listStyleType: 'none',
    padding: 0
  },
  analyzeButton: {
    marginTop: '20px',
    padding: '10px 20px',
    fontSize: '16px',
    color: 'white',
    backgroundColor: '#4CAF50',
    border: 'none',
    borderRadius: '20px',
    cursor: 'pointer'
  }
};

export default Main;
